import React from "react";
import Slider from "react-slick";
import "./Projects.css";

const GapownikCarosuel = () => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 700,
    slidesToShow: 1,
    slidesToScroll: 1,
    autoplay: false,
  };

  return (
    <Slider {...settings}>
      <div className="slide">
        <img src="../images/gap1.jpg" alt="gap1" />
        <h3>"Gapownik"</h3>
      </div>
      <div className="slide">
        <img src="../images/raportowanie.png" alt="Project 2" />
        <h3>"Raportowanie Wad"</h3>
      </div>
    </Slider>
  );
};

export default GapownikCarosuel;
